import { ButtonGroup } from "../constant/CommonFunction"
import { TabsType } from "../constant/types"
import { Tabs } from "../CustomTabs"
import ColumnChart from "./ColumnChart"

const Revenue = () => {

    const btns = [
        {label:'Revenue',value:'revenue'},
        {label:'Orders',value:'order'},
        {label:'Customers',value:'customer'}
    ]
    return(
        <div className="w-full">
            <div className='flex p-3 items-center justify-between border-b-[1px] border-[#0E253C1A]'>
                {/* <p className='text-black_200 font-semibold text-[18px]'>Recent Orders</p> */}
                <ButtonGroup btns={btns} />
                <Tabs tabs={btns} tabsClick={(val: TabsType) => {}} />
            </div>
            <ColumnChart />
        </div>
    )
}

export default Revenue
